pub enum DisposeOp {

    /// Leave the buffer unchanged.
    None = ,

    /// Clear buffer with the background color.
    Background = ,

    /// Reset the buffer to the state before the current frame.
    Previous = ,
}

pub enum BlendOp {

    /// Pixels overwrite the value at their position.
    Source = ,

    /// The new pixels are blended into the current state based on alpha.
    Over = ,
}

pub enum Compression {

    /// Default level  
    Default,

    /// Fast minimal compression
    Fast,

    /// Higher compression level  
    ///
    /// Best in this context isn't actually the highest possible level
    /// the encoder can do, but is meant to emulate the `Best` setting in the `Flate2`
    /// library.
    Best,
    Huffman,
    Rle,
}

pub enum DecodingError {
    IoError(io::Error),
    Format(Cow),
    InvalidSignature,
    CrcMismatch {
        /// bytes to skip to try to recover from this error
        recover: usize,
        /// Stored CRC32 value
        crc_val: u32,
        /// Calculated CRC32 sum
        crc_sum: u32,
        chunk: ChunkType,
    },
    Other(Cow),
    CorruptFlateStream,
    LimitsExceeded,
}
